INSERT INTO `tm_brand` VALUES ('1', '49292', 'Giuseppe Zanotti', 'Zanotti was born in San Mauro Pascoli, a village close to Rimini, Italy. In the 1980s, he worked as a DJ before becoming the renowned shoemaker he is today.\r\nHe started his fashion career in the 1980s. In the beginning, he started working locally with small craftsmen and then as a freelance designer working with fashion maisons like Valentino, Thierry Mugler, Missoni, Dior, Roberto Cavalli, and Gianfranco Ferré.', '', '', '', 'brand-giuseppe-zanotti.html', '1');
INSERT INTO `tm_brand` VALUES ('2', '49303', 'GUCCI', 'Beginning in a luggage store in 1921, Florence, Italy, Guccio Gucci established a small business dedicated to fine leather bags, shoes, gloves, and belts. What began as an entrepreneur\'s dream has evolved into a global powerhouse marked by excellence and tradition. From family owned to a public limited company, Gucci has maintained the highest standards of fashion while embracing innovation and change. As current creative director of Gucci, Frida Giannini has redefined the Italian brand, introducing a sensual, modern edge to over 90 years of superior quality craftsmanship. Recognized by the fashion elite for a commitment to exceptional quality, Gucci\'s Giannini has given decadence a fresh face with her flair for boho rock \'n\' roll. You\'ll still find the trusted signature \'GG\' goods but with updated silhouettes, bolder colors, exotic prints, animal skins, and stunning eyewear. Giannini\'s focus is not only on women\'s apparel but menswear, showcasing sporty, retro sneakers, chic ties, and classic dress shirts and suits. Gucci remains as iconic as ever with timeless, classic gifts, but moves forward with a sense of adventure. As the phoenix herself says, \"I always feel myself on fire.\"', '', '', '', 'brand-gucci.html', '1');
INSERT INTO `tm_brand` VALUES ('3', '3', 'Prada', 'If there\'s one thing every girl knows is that a Prada bag will complete her outfit, look, and wardrobe. Leather workers, Mario and Martino Prada opened a shop in 1913; however the company was revolutionized by their granddaughter Muiccia in 1970. What began with the success of the classic nylon tote, revolved into a shoe line to a ready to wear line. Today, the Prada insignia is recognized as the go to brand for style, class and Italian sensibility. ', '0', '0', '0', 'brand-Prada', '1');
INSERT INTO `tm_brand` VALUES ('4', '4', 'Christian Dior', 'After a stint as a small gallery owner and as head designer for the fashion house, Lucien Lelong, Christian Dior founded his couture house in 1946. During his debut collection, Dior revolutionized the industry by introducing the \'New Look\'. The small-waisted, full-skirted silhouette instantaneously set a new standard in post-WWII fashion, throwing the previous boxy, unflattering shape out the window. Today, with the signature flair of John Galliano, Dior is still widely praised for its glamorous designs and highly original thinking. ', '0', '0', '0', 'brand-Christian-Dior', '1');
INSERT INTO `tm_brand` VALUES ('5', '5', 'Jimmy Choo', 'Jimmy Choo is known as a man that can make a woman swoon over a pair of his handmade shoes. This London based designer was born into a family of shoe makers but it wasn\'t till 1988 when he was featured in an eight-page spread in UK Vogue that he changed the shoe world for so many women. In 1996, the UK Vogue accessories editor, Tamara Mellon co-founded Jimmy Choo and began a love affair between thousands of women and their shoes. ', '0', '0', '0', 'brand-Jimmy-Choo', '1');
